import React from 'react';
import {useLocation} from 'react-router-dom'

export default function CostumerDetails(props) {

    const costumersArray = props.costumersArray;
    const location = useLocation();
    const { costumerData } = location.state;
    console.log(costumerData);

    return (
      <div>
        
          <p style={{border:'2px solid blue',width:'40px'}}>{costumerData.name}</p>
          <p>{costumerData.id}</p>
          <p>{costumerData.address}</p>
          <p>{costumerData.phoneNumber}</p>
          <p>{costumerData.plateNumber}</p>
        
      </div>
    );
}
